import { useEffect, useState } from 'react';
import Select from './common/Select';
import { Sidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';

function SideBar(){
    return(
        // <div class="accordion" id="sideBarCours">
        //     <Select text='Mathématique' id="1" idParent="sideBarCours"/>
        //     <Select text='Français' id="2" idParent="sideBarCours"/>
        // </div>
        <div>
            <Sidebar>
                <Menu menuItemStyles={{
                    button: {
                        [`&.active`]: {
                        backgroundColor: '#13395e',
                        color: '#b6c8d9',
                        },
                    },
                }}>
                    <SubMenu label="Mathématique">
                        <MenuItem component={<Link to="/documentation" />}> Pie charts </MenuItem>
                        <MenuItem> Line charts </MenuItem>
                    </SubMenu>
                    <SubMenu label="Français">
                        <MenuItem> Pie charts </MenuItem>
                        <MenuItem> Line charts </MenuItem>
                    </SubMenu>
                    <SubMenu label="Sciences">
                        <MenuItem> Pie charts </MenuItem>
                        <MenuItem> Line charts </MenuItem>
                    </SubMenu>
                </Menu>
            </Sidebar>
        </div>
        
    )
}

export default SideBar;
